import React from 'react';
import { useLocation } from 'react-router-dom';
import { ToggleButton } from './actions/toggle.styled';

export default function TodoPageContainer() {
  const location = useLocation();
  const { todo } = location.state;
  const onToggle = () => {
    console.log(todo);
    console.log('onToggle');
  };

  return (
    <>
      <h1>{todo.title}</h1>
      <div>{todo.id}</div>
      <div>{todo.description}</div>
      <div>Complete: {String(todo.isCompleted)}</div>
      <div>Private: {String(todo.isPrivate)}</div>
      <ToggleButton isOn={todo.isPrivate} onToggle={onToggle} />
    </>
  );
}
